%spark

val decisionTreeClassifier = new DecisionTreeClassifier().setLabelCol("Threat").setFeaturesCol("selectedFeatures")

// We must create the pipeline first. Then we will run this pipeline many times, 
// with different estimator parameres given by a ParamGridBuilder
val decisionTreeClassifierPipeline = new Pipeline() 
    .setStages(Array(vectorAssembler, vectorIndexer, selectorChi, decisionTreeClassifier))


println("Training models for " + transformers.length + " transformers:")

for (transformer <- transformers) {
    println("\tTraining model for transformer " + transformer(0))
    runPipelineOnData(df, transformer(0).asInstanceOf[String], decisionTreeClassifierPipeline, "DTTransformer")
}

%spark


val randomForestClassifier = new RandomForestClassifier().setLabelCol("Threat").setFeaturesCol("selectedFeatures")

// We must create the pipeline first. Then we will run this pipeline many times, 
// with different estimator parameres given by a ParamGridBuilder
val pipelineRFChi = new Pipeline() 
    .setStages(Array(vectorAssembler, vectorIndexer, selectorChi, randomForestClassifier))


println("Training models for " + transformers.length + " transformers:")

for (transformer <- transformers) {
    println("\tTraining model for transformer " + transformer(0))
    runPipelineOnData(df, transformer(0).asInstanceOf[String], pipelineRFChi, "RFTransformer")
}
